import React from 'react';

import logoImg from '../../assets/icons/logo_white.svg'

const Logo = props => {

  // if some props were passed to this component,
  // save the props in the following variables:
  const id = props.id ? props.id : null;
  const onClick = props.onClick ? props.onClick : null;
  const styles = props.styles ? props.styles : null;

  return(
    <img 
      alt="Company Logo" 
      id={id}
      onClick={onClick}
      src={logoImg} 
      style="width: 100%;"
    />
  );
}; 

export default Logo;
